import React, { useState, Component } from 'react'
import DatePicker from "react-datepicker";
import 'react-datepicker/dist/react-datepicker-cssmodules.css';
import "react-datepicker/dist/react-datepicker.css";
import './css/main.css';
import './css/util.css';
import './signup.css';
import axios from 'axios'


export default class Logs extends Component {
    constructor(props) {
        super(props)

        this.state = { startDate: new Date()}
    }
    setStartDate = (date) => {
        this.setState({startDate: date})

    }

    handleSubmit = async () => {
        var date = this.state.startDate
        const response = await axios.get('http://localhost:5000/database')
        if(response.data.error) {
            this.setState({error: response.data.error})
        }
        else {
            this.setState({data: response.data.data, error: ""})
        }
    }

    componentDidMount = async () => {
        var date = this.state.startDate
          const response = await axios.get('http://localhost:5000/database')
          if(response.data.error) {
            this.setState({error: response.data.error})
        }
        else {
            this.setState({data: response.data.data, error: ""})
        }
    }


    render() {

        return (
            <>
            <nav class="navbar navbar-expand-lg navbar-light bg-white py-3 shadow-sm">
                <div id="navbarContent" class="collapse navbar-collapse">
                    <ul class="navbar-nav mx-auto">
                        <li class="nav-item"><a href="/" class="nav-link font-weight-bold text-uppercase">CAPTURE</a></li>
                        <li class="nav-item"><a href="/logs" class="nav-link font-weight-bold text-uppercase">LOGS</a></li>
                        <li class="nav-item"><a href="/database" class="nav-link font-weight-bold text-uppercase">DATABASE</a></li>
                    </ul>
                </div>
            </nav>
            <div class="container py-5">
                <div class="row">
                    <div class="col-lg-11 mx-auto">
                        <div class="row py-5">
                            {this.state.data.map()}
                            <div class="col-lg-4">
                                <figure class="rounded p-3 bg-white shadow-sm">
                                    <img src="https://i.postimg.cc/CxckQJW1/6.png" alt="" class="w-100 card-img-top" />
                                    <figcaption class="p-4 card-img-bottom">
                                    <h2 class="h5 font-weight-bold mb-2 font-italic">Image Caption</h2>
                                    <p class="mb-0 text-small text-muted font-italic">Phone Number</p>
                                    </figcaption>
                                </figure>
                            </div>
                        <div class="col-lg-4">
                            <figure class="rounded p-3 bg-white shadow-sm">
                                <img src="https://i.postimg.cc/BbvGMSDt/6.png" alt="" class="w-100 card-img-top" />
                                <figcaption class="p-4 card-img-bottom">
                                <h2 class="h5 font-weight-bold mb-2 font-italic">Image Caption</h2>
                                <p class="mb-0 text-small text-muted font-italic">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor.</p>
                                </figcaption>
                            </figure>
                        </div>
                        <div class="col-lg-4">
                            <figure class="rounded p-3 bg-white shadow-sm">
                                <img src="https://i.postimg.cc/W3bKP94H/6.png" alt="" class="w-100 card-img-top" />
                                <figcaption class="p-4 card-img-bottom">
                                <h2 class="h5 font-weight-bold mb-2 font-italic">Image Caption</h2>
                                <p class="mb-0 text-small text-muted font-italic">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor.</p>
                                </figcaption>
                            </figure>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </>)
    }
}
